import React from 'react';

const Navbar = () => {
    return (
        <nav style={{display: 'flex', justifyContent: 'flex-start'}} className='f3 link dim black pa3 pointer'>
               <p className='f3 link dim black pa2 pointer'>About</p>
               <p className='f3 link dim black pa2 pointer'>Projects</p>
        </nav>
    );
}

export default Navbar;
